import React from 'react';
function Education(){
    return(
        <div id="about" className = "container">
            <div className = "row">
                <p className = "display-6">Education</p>
            </div>
            <div className = "row">
                <div  className='col-9'>
                    <p className = "lead">B.Tech, LDRP Institute of Technology and Research</p>
                </div>
                <div  className='col-3'>
                <p className = "lead">June 2019- May 2022</p>
                </div>
            </div>
            <hr/>
        </div>
    );
}

export default Education;
